import * as Print from 'expo-print';
import * as Sharing from 'expo-sharing';
import { Alert } from 'react-native';

// Logo embutido em base64
const logoBase64 = "data:image/png;base64,"; // sua base64 aqui

const gerarPdfUnidade = async (dados = {}) => {
  console.log('Dados recebidos:', dados);

  const verificarAssinatura = (assinatura) => {
    if (!assinatura || typeof assinatura !== 'string') return '';
    return assinatura.startsWith('data:image') ? assinatura : '';
  };

  const formatarHora = (dataHoraString) => {
    if (!dataHoraString) return '';
    const data = new Date(dataHoraString);
    if (isNaN(data)) return '';
    return data.toLocaleTimeString('pt-BR', { hour: '2-digit', minute: '2-digit' });
  };

  const horaTecnico = formatarHora(dados?.horaAssinaturaTecnico);
  const horaCliente = formatarHora(dados?.horaAssinaturaCliente);
  const dataAtual = new Date().toLocaleDateString('pt-BR');

  try {
    const htmlContent = `
      <!DOCTYPE html>
      <html lang="pt-BR">
        <head>
          <meta charset="utf-8" />
          <style>
            @page {
              size: A4;
              margin: 32px;
            }
            body {
              font-family: Arial, sans-serif;
              font-size: 14px;
              color: #000;
              margin: 0;
              padding: 0;
              position: relative;
              min-height: 100%;
            }
            .content {
              padding: 32px;
              padding-bottom: 100px;
            }
            .logo {
              text-align: center;
              margin-bottom: 10px;
            }
            .logo img {
              max-width: 180px;
              height: auto;
            }
            .subtitle {
              text-align: center;
              font-size: 12px;
              color: #444;
              margin-bottom: 6px;
            }
            h1 {
              text-align: center;
              font-size: 20px;
              margin-top: 20px;
              margin-bottom: 30px;
            }
            p {
              margin: 6px 0;
            }
            .assinaturas {
              display: block;
              margin-top: 140px;
              text-align: center;
              white-space: nowrap;
            }
            .assinatura-item {
              display: inline-block;
              width: 45%;
              vertical-align: top;
              margin: 0 2.5%;
              white-space: normal;
            }
            .assinatura-item img {
              max-height: 80px;
              margin-bottom: 5px;
            }
            .linha-assinatura {
              margin-top: 5px;
              border-top: 1px solid #000;
              width: 100%;
              height: 1px;
            }
            .footer {
              position: fixed;
              bottom: 32px;
              left: 32px;
              right: 32px;
              text-align: right;
              font-size: 11px;
              color: #555;
            }
          </style>
        </head>
        <body>
          <div class="content">
            <div class="logo">
              <img src="${logoBase64}" alt="Logo Hospital" />
            </div>
            <div class="subtitle">Uma nova viso  possvel!</div>
            <div class="subtitle">
              MUNICIPAL: Lei n 961 de 28/08/68 | ESTADUAL: Lei n 10314 de 13/09/77<br />
              FEDERAL: Decreto de 11/09/92  Proc. M n 14555/90-441
            </div>

            <h1>Entrega de Equipamento - Unidade</h1>

            <p><strong>Data:</strong> ${dataAtual}</p>
            <p><strong>Unidade:</strong> ${dados?.unidade || 'No informada'}</p>
            <p><strong>Nome do Responsvel:</strong> ${dados?.nomeResponsavel || ''}</p>
            <p><strong>Setor:</strong> ${dados?.setor || ''}</p>
            <p><strong>Descrio do Equipamento:</strong> ${dados?.descricaoEquipamento || ''}</p>
            <p><strong>N do Patrimnio:</strong> ${dados?.numeroPatrimonio || ''}</p>
            <p><strong>Motivo:</strong> ${dados?.motivo || ''}</p>
            <p><strong>Nome do Tcnico:</strong> ${dados?.nomeTecnico || ''}</p>

            <div class="assinaturas">
              <div class="assinatura-item">
                <img src="${verificarAssinatura(dados?.assinaturaTecnico)}" alt="Assinatura do Tcnico" />
                <div class="linha-assinatura"></div>
                <p>${dados?.nomeTecnico || 'Tcnico'}<br />${horaTecnico}</p>
              </div>
              <div class="assinatura-item">
                <img src="${verificarAssinatura(dados?.assinaturaCliente)}" alt="Assinatura do Responsvel" />
                <div class="linha-assinatura"></div>
                <p>${dados?.nomeResponsavel || 'Responsvel'}<br />${horaCliente}</p>
              </div>
            </div>
          </div>

          <div class="footer">
            Hospital Mahatma Gandhi - Ordem de Servio | Pgina 1
          </div>
        </body>
      </html>
    `;

    const fileName = `pdf_unidade_${Date.now()}.pdf`;

    const { uri } = await Print.printToFileAsync({
      html: htmlContent,
      base64: false,
      width: 612,
      height: 792,
      fileName,
    });

    if (!uri) throw new Error('Falha ao gerar o PDF: URI no recebida.');

    console.log('PDF gerado com sucesso:', uri);

    const canShare = await Sharing.isAvailableAsync();
    if (!canShare) {
      Alert.alert('Erro', 'Compartilhamento no disponvel neste dispositivo.');
      return;
    }

    await Sharing.shareAsync(uri);

  } catch (error) {
    console.error('Erro ao gerar ou compartilhar PDF da unidade:', error);
    Alert.alert('Erro', 'Ocorreu um erro ao gerar ou compartilhar o PDF.');
  }
};

export default gerarPdfUnidade;
